local function changeskins()
    
    playerweapon = entity_get_player_weapon(localplayer)
    playerweapon = entity_get_classname(playerweapon)
    local playerteam = entity_get_prop(localplayer, "m_iTeamNum")
    
    if playerteam == 3 then
        playerteam = "CT"
    else
        playerteam = "T"
    end
    client_log(playerweapon)
    if entity_is_alive(localplayer) == true then
        weapon = weaponids[playerweapon]
        local skin = ui_get(weapons_references[playerteam][weapon])
        local Stattrak = ui_get(stattrak_references[playerteam][weapon])
        local skinwear = ui_get(quality_references[playerteam][weapon])
        local changeto = SkinIds[skin]
        
        if currentskin[playerteam][weapon][1] ~= changeto then

            table_remove(currentskin[playerteam][weapon], 1)
            table_insert(currentskin[playerteam][weapon], changeto)
            ui_set(skinBox, changeto)
            ui_set(enableStattrak, Stattrak)
            ui_set(wear, skinwear)
            
        end
    end
end

local function changeGloveM()
    playerweapon = entity_get_player_weapon(localplayer)
    playerweapon = entity_get_classname(playerweapon)
    local playerteam = entity_get_prop(localplayer, "m_iTeamNum")
    
    if playerteam == 3 then
        playerteam = "CT"
    else
        playerteam = "T"
    end
    local GloveM = ui_get(gloveM_references[playerteam])
    if currentgloveM[playerteam][1] ~= GloveM then
        table_remove(currentgloveM[playerteam], 1)
        table_insert(currentgloveM[playerteam], GloveM)
        ui_set(GlovesModel, GloveM)
        
    end
    
end

local function changeGloveS()
    playerweapon = entity_get_player_weapon(localplayer)
    playerweapon = entity_get_classname(playerweapon)
    local playerteam = entity_get_prop(localplayer, "m_iTeamNum")
    
    if playerteam == 3 then
        playerteam = "CT"
    else
        playerteam = "T"
    end
    local gloveM = ui_get(gloveM_references[playerteam])
    local glove = ui_get(gloveS_references[playerteam][gloveM])
    GloveS = GloveIDs[glove]
    if currentgloveS[playerteam][1] ~= gloveS then
        table.remove(currentgloveS[playerteam], 1)
        table_insert(currentgloveS[playerteam], GloveS)
        ui_set(GlovesSkinBox, GloveS)
    end
end
local function changeKnifeM()
    local playerteam = entity_get_prop(localplayer, "m_iTeamNum")
    
    if playerteam == 3 then
